module.exports = "<article><nz-affix class=\"toc-affix\" [nzOffsetTop]=\"16\">\n    <nz-anchor [nzAffix]=\"false\" nzShowInkInFixed (nzClick)=\"goLink($event)\">\n      <nz-link nzHref=\"#components-notification-demo-basic\" nzTitle=\"Basic\"></nz-link><nz-link nzHref=\"#components-notification-demo-duration\" nzTitle=\"Duration after which the notification box is closed\"></nz-link><nz-link nzHref=\"#components-notification-demo-with-icon\" nzTitle=\"Notification with icon\"></nz-link><nz-link nzHref=\"#components-notification-demo-with-btn\" nzTitle=\"Custom close button\"></nz-link><nz-link nzHref=\"#components-notification-demo-custom-icon\" nzTitle=\"Customized Icon\"></nz-link><nz-link nzHref=\"#components-notification-demo-placement\" nzTitle=\"Placement\"></nz-link><nz-link nzHref=\"#components-notification-demo-custom-style\" nzTitle=\"Customized style\"></nz-link>\n    </nz-anchor>\n  </nz-affix><section class=\"markdown\">\n\t<h1>Notification<span class=\"subtitle\"></span>\n\t<a class=\"edit-button\" href=\"https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/doc/index.en-US.md\" target=\"_blank\">\n\t\t<i nz-icon type=\"edit\"></i></a>\n</h1>\n\t<section class=\"markdown\" ngNonBindable>\n\t\t<p>Display a notification message globally.</p>\n<h2 id=\"when-to-use\"><span>When To Use</span><a onclick=\"window.location.hash = 'when-to-use'\" class=\"anchor\">#</a></h2><p>To display a notification message at any of the four corners of the viewport. Typically it can be\nused in the following cases:</p>\n<ul>\n<li>A notification with complex content.</li>\n<li>A notification providing a feedback based on the user interaction. Or it may show some details\nabout upcoming steps the user may have to follow.</li>\n<li>A notification that is pushed by the application.</li>\n</ul>\n<h2 id=\"how-to-use\"><span>How To Use</span><a onclick=\"window.location.hash = 'how-to-use'\" class=\"anchor\">#</a></h2><p>Similar to <code>NzMessage</code>, if you want to modify the global default configuration, you can modify the value of provider <code>NZ_NOTIFICATION_CONFIG</code>.\n(Example: Add <code>&#123; provide: NZ_NOTIFICATION_CONFIG, useValue: &#123; nzDuration: 3000 &#125;&#125;</code> to <code>providers</code> of your module, <code>NZ_NOTIFICATION_CONFIG</code> can be imported from <code>ng-zorro-antd</code>)</p>\n<p>The default global configuration is:</p>\n<pre><code class=\"lang-js\"><span class=\"token punctuation\">&#123;</span>\n  nzTop         <span class=\"token punctuation\">:</span> <span class=\"token string\">'24px'</span><span class=\"token punctuation\">,</span>\n  nzBottom      <span class=\"token punctuation\">:</span> <span class=\"token string\">'24px'</span><span class=\"token punctuation\">,</span>\n  nzPlacement   <span class=\"token punctuation\">:</span> <span class=\"token string\">'topRight'</span><span class=\"token punctuation\">,</span>\n  nzDuration    <span class=\"token punctuation\">:</span> <span class=\"token number\">4500</span><span class=\"token punctuation\">,</span>\n  nzMaxStack    <span class=\"token punctuation\">:</span> <span class=\"token number\">7</span><span class=\"token punctuation\">,</span>\n  nzPauseOnHover<span class=\"token punctuation\">:</span> <span class=\"token boolean\">true</span><span class=\"token punctuation\">,</span>\n  nzAnimate     <span class=\"token punctuation\">:</span> <span class=\"token boolean\">true</span>\n <span class=\"token punctuation\">&#125;</span>\n</code></pre>\n\n\t</section>\n\t\n\t<h2>\n\t\t<span>Examples</span>\n\t\t<i nz-icon type=\"appstore\" class=\"code-box-expand-trigger\" title=\"expand all code\" (click)=\"expandAllCode()\"></i>\n\t</h2>\n</section><div nz-row [nzGutter]=\"16\">\n\t<div nz-col [nzLg]=\"12\" [nzMd]=\"24\">\n\t\t<nz-code-box nzTitle=\"Basic\" [nzId]=\"'components-notification-demo-basic'\" nzSelector=\"nz-demo-notification-basic\" [nzLink]=\"'components-notification-demo-basic'\" nzGenerateCommand=\"ng g ng-zorro-antd:notification-basic -p app --name=\" nzComponentName=\"NzDemoNotificationBasicComponent\" [nzCode]=\"basic\" [nzRawCode]=\"basicRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/demo/basic.md'\">\n\t<nz-demo-notification-basic demo></nz-demo-notification-basic>\n\t<div intro ngNonBindable>\n\t\t<p>The simplest usage that close the notification box after 4.5s.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Notification with icon\" [nzId]=\"'components-notification-demo-with-icon'\" nzSelector=\"nz-demo-notification-with-icon\" [nzLink]=\"'components-notification-demo-with-icon'\" nzGenerateCommand=\"ng g ng-zorro-antd:notification-with-icon -p app --name=\" nzComponentName=\"NzDemoNotificationWithIconComponent\" [nzCode]=\"withIcon\" [nzRawCode]=\"withIconRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/demo/with-icon.md'\">\n\t<nz-demo-notification-with-icon demo></nz-demo-notification-with-icon>\n\t<div intro ngNonBindable>\n\t\t<p>A notification box with a icon at the left side.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Customized Icon\" [nzId]=\"'components-notification-demo-custom-icon'\" nzSelector=\"nz-demo-notification-custom-icon\" [nzLink]=\"'components-notification-demo-custom-icon'\" nzGenerateCommand=\"ng g ng-zorro-antd:notification-custom-icon -p app --name=\" nzComponentName=\"NzDemoNotificationCustomIconComponent\" [nzCode]=\"customIcon\" [nzRawCode]=\"customIconRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/demo/custom-icon.md'\">\n\t<nz-demo-notification-custom-icon demo></nz-demo-notification-custom-icon>\n\t<div intro ngNonBindable>\n\t\t<p>The icon can be customized to any <code>TemplateRef&lt;void&gt;</code>.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Customized style\" [nzId]=\"'components-notification-demo-custom-style'\" nzSelector=\"nz-demo-notification-custom-style\" [nzLink]=\"'components-notification-demo-custom-style'\" nzGenerateCommand=\"ng g ng-zorro-antd:notification-custom-style -p app --name=\" nzComponentName=\"NzDemoNotificationCustomStyleComponent\" [nzCode]=\"customStyle\" [nzRawCode]=\"customStyleRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/demo/custom-style.md'\">\n\t<nz-demo-notification-custom-style demo></nz-demo-notification-custom-style>\n\t<div intro ngNonBindable>\n\t\t<p>The nzStyle and nzClass are available to customize Notification.</p>\n\n\t</div>\n</nz-code-box>\n\n\t</div>\n\t<div nz-col [nzLg]=\"12\" [nzMd]=\"24\">\n\t\t<nz-code-box nzTitle=\"Duration after which the notification box is closed\" [nzId]=\"'components-notification-demo-duration'\" nzSelector=\"nz-demo-notification-duration\" [nzLink]=\"'components-notification-demo-duration'\" nzGenerateCommand=\"ng g ng-zorro-antd:notification-duration -p app --name=\" nzComponentName=\"NzDemoNotificationDurationComponent\" [nzCode]=\"duration\" [nzRawCode]=\"durationRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/demo/duration.md'\">\n\t<nz-demo-notification-duration demo></nz-demo-notification-duration>\n\t<div intro ngNonBindable>\n\t\t<p><code>nzDuration</code> can be used to specify how long the notification stays open. After the duration time elapses,\nthe notification closes automatically. If not specified, default value is 4.5 seconds. If you set the value to 0,\nthe notification box will never close automatically.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Custom close button\" [nzId]=\"'components-notification-demo-with-btn'\" nzSelector=\"nz-demo-notification-with-btn\" [nzLink]=\"'components-notification-demo-with-btn'\" nzGenerateCommand=\"ng g ng-zorro-antd:notification-with-btn -p app --name=\" nzComponentName=\"NzDemoNotificationWithBtnComponent\" [nzCode]=\"withBtn\" [nzRawCode]=\"withBtnRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/demo/with-btn.md'\">\n\t<nz-demo-notification-with-btn demo></nz-demo-notification-with-btn>\n\t<div intro ngNonBindable>\n\t\t<p>To customize the style or font of the close button.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Placement\" [nzId]=\"'components-notification-demo-placement'\" nzSelector=\"nz-demo-notification-placement\" [nzLink]=\"'components-notification-demo-placement'\" nzGenerateCommand=\"ng g ng-zorro-antd:notification-placement -p app --name=\" nzComponentName=\"NzDemoNotificationPlacementComponent\" [nzCode]=\"placement\" [nzRawCode]=\"placementRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/demo/placement.md'\">\n\t<nz-demo-notification-placement demo></nz-demo-notification-placement>\n\t<div intro ngNonBindable>\n\t\t<p>A notification box can pop up from <code>topRight</code> or <code>bottomRight</code> or <code>bottomLeft</code> or <code>topLeft</code>.</p>\n\n\t</div>\n</nz-code-box>\n\n\t</div>\n</div>\n<section class=\"markdown api-container\" ngNonBindable><h2 id=\"api\"><span>API</span><a onclick=\"window.location.hash = 'api'\" class=\"anchor\">#</a></h2><h3 id=\"nznotificationservice\"><span>NzNotificationService</span><label class=\"api-type-label service\">service</label><a onclick=\"window.location.hash = 'nznotificationservice'\" class=\"anchor\">#</a></h3><p>The component provides a number of service methods using the following methods and parameters:</p>\n<ul>\n<li><code>NzNotificationService.blank(title, content, [options])</code> // Notification without icon</li>\n<li><code>NzNotificationService.success(title, content, [options])</code></li>\n<li><code>NzNotificationService.error(title, content, [options])</code></li>\n<li><code>NzNotificationService.info(title, content, [options])</code></li>\n<li><code>NzNotificationService.warning(title, content, [options])</code></li>\n</ul>\n<table>\n<thead>\n<tr>\n<th>Argument</th>\n<th>Description</th>\n<th>Type</th>\n<th>Default</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>title</td>\n<td>Title</td>\n<td>string</td>\n<td>-</td>\n</tr>\n<tr>\n<td>content</td>\n<td>Notification content</td>\n<td>string</td>\n<td>-</td>\n</tr>\n<tr>\n<td>options</td>\n<td>Support setting the parameters for the current notification box, see the table below</td>\n<td>object</td>\n<td>-</td>\n</tr>\n</tbody>\n</table>\n<p>The parameters that are set by the <code>options</code> support are as follows:</p>\n<table>\n<thead>\n<tr>\n<th>Argument</th>\n<th>Description</th>\n<th>Type</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>nzDuration</td>\n<td>Duration (milliseconds), does not disappear when set to 0</td>\n<td>number</td>\n</tr>\n<tr>\n<td>nzPauseOnHover</td>\n<td>Do not remove automatically when mouse is over while setting to <code>true</code></td>\n<td>boolean</td>\n</tr>\n<tr>\n<td>nzAnimate</td>\n<td>Whether to turn on animation</td>\n<td>boolean</td>\n</tr>\n<tr>\n<td>nzStyle</td>\n<td>Custom inline style</td>\n<td>object</td>\n</tr>\n<tr>\n<td>nzClass</td>\n<td>Custom CSS class</td>\n<td>object</td>\n</tr>\n</tbody>\n</table>\n<p>Methods for destruction are also provided:</p>\n<ul>\n<li><code>NzNotificationService.remove(id)</code> // Remove the notification with the specified id. When the id is empty, remove all notifications (the notification id is returned by the above method)</li>\n</ul>\n<h3 id=\"global-configuration-(nz_message_config)\"><span>Global configuration (NZ_MESSAGE_CONFIG)</span><a onclick=\"window.location.hash = 'global-configuration-(nz_message_config)'\" class=\"anchor\">#</a></h3><table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>nzDuration</td>\n<td>Duration (milliseconds), does not disappear when set to 0</td>\n<td>number</td>\n<td>4500</td>\n</tr>\n<tr>\n<td>nzMaxStack</td>\n<td>The maximum number of notifications that can be displayed at the same time</td>\n<td>number</td>\n<td>8</td>\n</tr>\n<tr>\n<td>nzPauseOnHover</td>\n<td>Do not remove automatically when mouse is over while setting to <code>true</code></td>\n<td>boolean</td>\n<td>true</td>\n</tr>\n<tr>\n<td>nzAnimate</td>\n<td>Whether to turn on animation</td>\n<td>boolean</td>\n<td>true</td>\n</tr>\n<tr>\n<td>nzTop</td>\n<td>The top of the notification when it pops up from the top.</td>\n<td>string</td>\n<td>24px</td>\n</tr>\n<tr>\n<td>nzBottom</td>\n<td>The bottom of the notification when it pops up from the bottom.</td>\n<td>string</td>\n<td>24px</td>\n</tr>\n<tr>\n<td>nzPlacement</td>\n<td>Popup position, optional <code>topLeft</code> <code>topRight</code> <code>bottomLeft</code> <code>bottomRight</code></td>\n<td>string</td>\n<td><code>topRight</code></td>\n</tr>\n</tbody>\n</table>\n</section></article>"

