module.exports = "<article><nz-affix class=\"toc-affix\" [nzOffsetTop]=\"16\">\n    <nz-anchor [nzAffix]=\"false\" nzShowInkInFixed (nzClick)=\"goLink($event)\">\n      <nz-link nzHref=\"#components-notification-demo-basic\" nzTitle=\"基本\"></nz-link><nz-link nzHref=\"#components-notification-demo-duration\" nzTitle=\"自动关闭的延时\"></nz-link><nz-link nzHref=\"#components-notification-demo-with-icon\" nzTitle=\"带有图标的通知提醒框\"></nz-link><nz-link nzHref=\"#components-notification-demo-with-btn\" nzTitle=\"自定义按钮\"></nz-link><nz-link nzHref=\"#components-notification-demo-custom-icon\" nzTitle=\"自定义图标\"></nz-link><nz-link nzHref=\"#components-notification-demo-placement\" nzTitle=\"位置\"></nz-link><nz-link nzHref=\"#components-notification-demo-custom-style\" nzTitle=\"自定义样式\"></nz-link>\n    </nz-anchor>\n  </nz-affix><section class=\"markdown\">\n\t<h1>Notification<span class=\"subtitle\">通知提醒框</span>\n\t<a class=\"edit-button\" href=\"https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/doc/index.zh-CN.md\" target=\"_blank\">\n\t\t<i nz-icon type=\"edit\"></i></a>\n</h1>\n\t<section class=\"markdown\" ngNonBindable>\n\t\t<p>全局展示通知提醒信息。</p>\n<h2 id=\"何时使用\"><span>何时使用</span><a onclick=\"window.location.hash = '何时使用'\" class=\"anchor\">#</a></h2><p>在系统四个角显示通知提醒信息。经常用于以下情况：</p>\n<ul>\n<li>较为复杂的通知内容。</li>\n<li>带有交互的通知，给出用户下一步的行动点。</li>\n<li>系统主动推送。</li>\n</ul>\n<h2 id=\"如何使用\"><span>如何使用</span><a onclick=\"window.location.hash = '如何使用'\" class=\"anchor\">#</a></h2><p>与<code>NzMessage</code>类似，如果要修改全局默认配置，你可以设置提供商 <code>NZ_NOTIFICATION_CONFIG</code> 的值来修改。\n（如：在你的模块的<code>providers</code>中加入 <code>&#123; provide: NZ_NOTIFICATION_CONFIG, useValue: &#123; nzDuration: 3000 &#125;&#125;</code>，<code>NZ_NOTIFICATION_CONFIG</code> 可以从 <code>ng-zorro-antd</code> 中导入）</p>\n<p>默认全局配置为：</p>\n<pre><code class=\"lang-js\"><span class=\"token punctuation\">&#123;</span>\n  nzTop         <span class=\"token punctuation\">:</span> <span class=\"token string\">'24px'</span><span class=\"token punctuation\">,</span>\n  nzBottom      <span class=\"token punctuation\">:</span> <span class=\"token string\">'24px'</span><span class=\"token punctuation\">,</span>\n  nzPlacement   <span class=\"token punctuation\">:</span> <span class=\"token string\">'topRight'</span><span class=\"token punctuation\">,</span>\n  nzDuration    <span class=\"token punctuation\">:</span> <span class=\"token number\">4500</span><span class=\"token punctuation\">,</span>\n  nzMaxStack    <span class=\"token punctuation\">:</span> <span class=\"token number\">7</span><span class=\"token punctuation\">,</span>\n  nzPauseOnHover<span class=\"token punctuation\">:</span> <span class=\"token boolean\">true</span><span class=\"token punctuation\">,</span>\n  nzAnimate     <span class=\"token punctuation\">:</span> <span class=\"token boolean\">true</span>\n <span class=\"token punctuation\">&#125;</span>\n</code></pre>\n\n\t</section>\n\t\n\t<h2>\n\t\t<span>代码演示</span>\n\t\t<i nz-icon type=\"appstore\" class=\"code-box-expand-trigger\" title=\"展开全部代码\" (click)=\"expandAllCode()\"></i>\n\t</h2>\n</section><div nz-row [nzGutter]=\"16\">\n\t<div nz-col [nzLg]=\"12\" [nzMd]=\"24\">\n\t\t<nz-code-box nzTitle=\"基本\" [nzId]=\"'components-notification-demo-basic'\" nzSelector=\"nz-demo-notification-basic\" [nzLink]=\"'components-notification-demo-basic'\" nzGenerateCommand=\"ng g ng-zorro-antd:notification-basic -p app --name=\" nzComponentName=\"NzDemoNotificationBasicComponent\" [nzCode]=\"basic\" [nzRawCode]=\"basicRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/demo/basic.md'\">\n\t<nz-demo-notification-basic demo></nz-demo-notification-basic>\n\t<div intro ngNonBindable>\n\t\t<p>最简单的用法，4.5 秒后自动关闭。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"带有图标的通知提醒框\" [nzId]=\"'components-notification-demo-with-icon'\" nzSelector=\"nz-demo-notification-with-icon\" [nzLink]=\"'components-notification-demo-with-icon'\" nzGenerateCommand=\"ng g ng-zorro-antd:notification-with-icon -p app --name=\" nzComponentName=\"NzDemoNotificationWithIconComponent\" [nzCode]=\"withIcon\" [nzRawCode]=\"withIconRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/demo/with-icon.md'\">\n\t<nz-demo-notification-with-icon demo></nz-demo-notification-with-icon>\n\t<div intro ngNonBindable>\n\t\t<p>通知提醒框左侧有图标。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"自定义图标\" [nzId]=\"'components-notification-demo-custom-icon'\" nzSelector=\"nz-demo-notification-custom-icon\" [nzLink]=\"'components-notification-demo-custom-icon'\" nzGenerateCommand=\"ng g ng-zorro-antd:notification-custom-icon -p app --name=\" nzComponentName=\"NzDemoNotificationCustomIconComponent\" [nzCode]=\"customIcon\" [nzRawCode]=\"customIconRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/demo/custom-icon.md'\">\n\t<nz-demo-notification-custom-icon demo></nz-demo-notification-custom-icon>\n\t<div intro ngNonBindable>\n\t\t<p>图标可以被自定义。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"自定义样式\" [nzId]=\"'components-notification-demo-custom-style'\" nzSelector=\"nz-demo-notification-custom-style\" [nzLink]=\"'components-notification-demo-custom-style'\" nzGenerateCommand=\"ng g ng-zorro-antd:notification-custom-style -p app --name=\" nzComponentName=\"NzDemoNotificationCustomStyleComponent\" [nzCode]=\"customStyle\" [nzRawCode]=\"customStyleRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/demo/custom-style.md'\">\n\t<nz-demo-notification-custom-style demo></nz-demo-notification-custom-style>\n\t<div intro ngNonBindable>\n\t\t<p>使用 nzStyle 和 nzClass 来定义样式。</p>\n\n\t</div>\n</nz-code-box>\n\n\t</div>\n\t<div nz-col [nzLg]=\"12\" [nzMd]=\"24\">\n\t\t<nz-code-box nzTitle=\"自动关闭的延时\" [nzId]=\"'components-notification-demo-duration'\" nzSelector=\"nz-demo-notification-duration\" [nzLink]=\"'components-notification-demo-duration'\" nzGenerateCommand=\"ng g ng-zorro-antd:notification-duration -p app --name=\" nzComponentName=\"NzDemoNotificationDurationComponent\" [nzCode]=\"duration\" [nzRawCode]=\"durationRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/demo/duration.md'\">\n\t<nz-demo-notification-duration demo></nz-demo-notification-duration>\n\t<div intro ngNonBindable>\n\t\t<p>自定义通知框自动关闭的延时，默认<code>4.5s</code>，取消自动关闭只要将该值设为 <code>0</code> 即可。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"自定义按钮\" [nzId]=\"'components-notification-demo-with-btn'\" nzSelector=\"nz-demo-notification-with-btn\" [nzLink]=\"'components-notification-demo-with-btn'\" nzGenerateCommand=\"ng g ng-zorro-antd:notification-with-btn -p app --name=\" nzComponentName=\"NzDemoNotificationWithBtnComponent\" [nzCode]=\"withBtn\" [nzRawCode]=\"withBtnRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/demo/with-btn.md'\">\n\t<nz-demo-notification-with-btn demo></nz-demo-notification-with-btn>\n\t<div intro ngNonBindable>\n\t\t<p>自定义关闭按钮的样式和文字。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"位置\" [nzId]=\"'components-notification-demo-placement'\" nzSelector=\"nz-demo-notification-placement\" [nzLink]=\"'components-notification-demo-placement'\" nzGenerateCommand=\"ng g ng-zorro-antd:notification-placement -p app --name=\" nzComponentName=\"NzDemoNotificationPlacementComponent\" [nzCode]=\"placement\" [nzRawCode]=\"placementRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/notification/demo/placement.md'\">\n\t<nz-demo-notification-placement demo></nz-demo-notification-placement>\n\t<div intro ngNonBindable>\n\t\t<p>可以设置通知从右上角、右下角、左下角、左上角弹出。</p>\n\n\t</div>\n</nz-code-box>\n\n\t</div>\n</div>\n<section class=\"markdown api-container\" ngNonBindable><h2 id=\"api\"><span>API</span><a onclick=\"window.location.hash = 'api'\" class=\"anchor\">#</a></h2><h3 id=\"nznotificationservice\"><span>NzNotificationService</span><label class=\"api-type-label service\">service</label><a onclick=\"window.location.hash = 'nznotificationservice'\" class=\"anchor\">#</a></h3><p>组件提供了一些服务方法，使用方式和参数如下：</p>\n<ul>\n<li><code>NzNotificationService.blank(title, content, [options])</code> // 不带图标的提示</li>\n<li><code>NzNotificationService.success(title, content, [options])</code></li>\n<li><code>NzNotificationService.error(title, content, [options])</code></li>\n<li><code>NzNotificationService.info(title, content, [options])</code></li>\n<li><code>NzNotificationService.warning(title, content, [options])</code></li>\n</ul>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>title</td>\n<td>标题</td>\n<td>string</td>\n<td>-</td>\n</tr>\n<tr>\n<td>content</td>\n<td>提示内容</td>\n<td>string</td>\n<td>-</td>\n</tr>\n<tr>\n<td>options</td>\n<td>支持设置针对当前提示框的参数，见下方表格</td>\n<td>object</td>\n<td>-</td>\n</tr>\n</tbody>\n</table>\n<p><code>options</code> 支持设置的参数如下：</p>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>nzDuration</td>\n<td>持续时间(毫秒)，当设置为0时不消失</td>\n<td>number</td>\n</tr>\n<tr>\n<td>nzPauseOnHover</td>\n<td>鼠标移上时禁止自动移除</td>\n<td>boolean</td>\n</tr>\n<tr>\n<td>nzAnimate</td>\n<td>开关动画效果</td>\n<td>boolean</td>\n</tr>\n<tr>\n<td>nzStyle</td>\n<td>自定义内联样式</td>\n<td>object</td>\n</tr>\n<tr>\n<td>nzClass</td>\n<td>自定义 CSS class</td>\n<td>object</td>\n</tr>\n</tbody>\n</table>\n<p>还提供了全局销毁方法：</p>\n<ul>\n<li><code>NzNotificationService.remove(id)</code> // 移除特定id的消息，当id为空时，移除所有消息（该消息id通过上述方法返回值中得到）</li>\n</ul>\n<h3 id=\"全局配置（nz_message_config）\"><span>全局配置（NZ_MESSAGE_CONFIG）</span><a onclick=\"window.location.hash = '全局配置（nz_message_config）'\" class=\"anchor\">#</a></h3><table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>nzDuration</td>\n<td>持续时间(毫秒)，当设置为0时不消失</td>\n<td>number</td>\n<td>4500</td>\n</tr>\n<tr>\n<td>nzMaxStack</td>\n<td>同一时间可展示的最大提示数量</td>\n<td>number</td>\n<td>8</td>\n</tr>\n<tr>\n<td>nzPauseOnHover</td>\n<td>鼠标移上时禁止自动移除</td>\n<td>boolean</td>\n<td>true</td>\n</tr>\n<tr>\n<td>nzAnimate</td>\n<td>开关动画效果</td>\n<td>boolean</td>\n<td>true</td>\n</tr>\n<tr>\n<td>nzTop</td>\n<td>消息从顶部弹出时，距离顶部的位置。</td>\n<td>string</td>\n<td>24px</td>\n</tr>\n<tr>\n<td>nzBottom</td>\n<td>消息从底部弹出时，距离底部的位置。</td>\n<td>string</td>\n<td>24px</td>\n</tr>\n<tr>\n<td>nzPlacement</td>\n<td>弹出位置，可选 <code>topLeft</code> <code>topRight</code> <code>bottomLeft</code> <code>bottomRight</code></td>\n<td>string</td>\n<td><code>topRight</code></td>\n</tr>\n</tbody>\n</table>\n</section></article>"

